import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />


        <div class="container">

          <div class="row">
            <div class="card col-md">
              <div class="card-body">
                <h5 class="card-title">BB Ações Energia</h5>
                <p class="card-text">Rentabilidade: 8% a.a</p>
              </div>
            </div>
            <div class="card col">
              <div class="card-body">
                <h5 class="card-title">BB Ações Energia</h5>
                <p class="card-text">Rentabilidade: 8% a.a</p>
              </div>
            </div>
          </div>
        </div>

      </header>
    </div>
  );
}

export default App;
